  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:24.303893\",\n\t\"name\": \"mass-removal-of-pest-fish-from-five-waikato-lakes-of-5-ha-or-greater\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"At least one mass harvesting system for
  pest fish has been tested. Biomass reductions achieved have been established, and
  environmental responses have been quantified. Field trials of at least one mass
  harvest technique have been successfully undertaken; costs and reductions of pest
  fish biomass and recovery of indigenous biodiversity have been quantified. The optimum
  threshold biomass required to achieve significant biodiversity recovery has been
  calculated and recorded on LERNZ. The minimum target threshold biomass has been
  modelled for at least 5 lakes of over 5 ha in area. Results have been published
  in an internationally recognised journal (achievement goal as stated in the original
  FRST contract).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
